import React from 'react';
import { useNavigate } from 'react-router-dom';

function CardEspecialidade({ especialidade }) {
  const navigate = useNavigate();

  const handleClick = () => {
    navigate(`/servicos/${especialidade}`);
  };

  return (
    <div className="card m-2 p-3 text-center shadow-sm" style={{ cursor: 'pointer' }} onClick={handleClick}>
      <h5>{especialidade}</h5>
      <p>Clique para ver os médicos disponíveis</p>
    </div>
  );
}

export default CardEspecialidade;
